content/java/immutable/immutable.html.body:
Immutable
Immutable class means that once an object is created, we cannot change its content. In Java, all the wrapper classes (like Integer, Boolean, Byte, Short) and String class is immutable. We can create our own immutable class as well.
Following are the requirements

Declare the class as final so it can’t be extended.

Make all fields private so that direct access is not allowed.

Don’t provide setter methods for variables

Make all mutable fields final so that it’s value can be assigned only once.

Initialize all the fields via a constructor performing deep copy.

Perform cloning of objects in the getter methods to return a copy rather than returning the actual object reference.


public final class FinalClassExample {

    private final int id;

    private final String name;

    private final HashMap testMap;

    public int getId() {
        return id;
    }
    public String getName() {
        return name;
    }

    /**
     * Accessor function for mutable objects
     */
    public HashMap getTestMap() {
        //return testMap;
        return (HashMap) testMap.clone();
    }

    /**
     * Constructor performing Deep Copy
     * @param i
     * @param n
     * @param hm
     */

    public FinalClassExample(int i, String n, HashMap hm){
        System.out.println("Performing Deep Copy for Object initialization");
        this.id=i;
        this.name=n;
        HashMap tempMap=new HashMap();
        String key;
        Iterator it = hm.keySet().iterator();
        while(it.hasNext()){
            key=it.next();
            tempMap.put(key, hm.get(key));
        }
        this.testMap=tempMap;
    }
}

content/java/serialize/serialize.html.body:
Serialization and Deserialization
Serialization is a mechanism of converting the state of an object into a byte stream. Deserialization is the reverse process where the byte stream is used to recreate the actual Java object in memory. This mechanism is used to persist the object.
The byte stream created is platform independent. So, the object serialized on one platform can be deserialized on a different platform.
To make a Java object serializable we implement the java.io.Serializable or java.io.Externalizable interface.
java.io.Serializable is marker interface having no fields and methods.
java.io.Externalizable provides extra functionality to control over serialization process. We can write few properties of an object. It has two methods 

public void writeExternal(ObjectOutput oo) throws IOException
public void readExternal(ObjectInput in) throws IOException,  ClassNotFoundException

Note -
Constructor calling depends on what interface you implement Serializable or Externalizable while doing deserialization
The ObjectOutputStream class contains writeObject() method for serializing an Object.
public final void writeObject(Object obj)
                       throws IOException

The ObjectInputStream class contains readObject() method for deserializing an object.
public final Object readObject() throws IOException, ClassNotFoundException


If a parent class has implemented Serializable interface then child class doesn’t need to implement it but vice-versa is not true.
Only non-static data members are saved via Serialization process.
Static data members and transient data members are not saved via Serialization process.So, if you don’t want to save value of a non-static data member then make it transient.
Calling of constructor depends on what interface you implement (Serializable or Externalizable)
Associated objects must be implementing Serializable or Externalizable interface.

SerialVersionUID
The Serialization runtime associates a version number with each Serializable class called a SerialVersionUID, which is used during Deserialization to verify that sender and reciever of a serialized object have loaded classes for that object which are compatible with respect to serialization. If the reciever has loaded a class for the object that has different UID than that of corresponding sender’s class, the Deserialization will result in an InvalidClassException. A Serializable class can declare its own UID explicitly by declaring a field name.
It must be static, final and of type long.
i.e- ANY-ACCESS-MODIFIER static final long serialVersionUID=42L;
Serialver
The serialver is a tool that comes with JDK. It is used to get serialVersionUID number for Java classes.
Example of Serializable
class Demo implements java.io.Serializable { 
    public int a; 
    public String b; 

    // Default constructor 
    public Demo(int a, String b) { 
        this.a = a; 
        this.b = b; 
    } 

} 

class Test { 
    public static void main(String[] args) {

        Demo object = new Demo(1, "geeksforgeeks"); 
        String filename = "file.ser"; 

        // Serialization  
        try {    
            //Saving of object in a file 
            FileOutputStream file = new FileOutputStream(filename); 
            ObjectOutputStream out = new ObjectOutputStream(file); 

            // Method for serialization of object 
            out.writeObject(object); 

            out.close(); 
            file.close(); 

            System.out.println("Object has been serialized"); 

        } catch(IOException ex) { 
            System.out.println("IOException is caught"); 
        } 

        Demo object1 = null; 

        // Deserialization 
        try {    
            // Reading the object from a file 
            FileInputStream file = new FileInputStream(filename); 
            ObjectInputStream in = new ObjectInputStream(file); 

            // Method for deserialization of object 
            object1 = (Demo)in.readObject(); 

            in.close(); 
            file.close(); 

            System.out.println("Object has been deserialized "); 
            System.out.println("a = "+ object1.a); 
            System.out.println("b = "+ object1.b); 
        } catch (IOException ex) { 
            System.out.println(``"IOException is caught"``); 
        } catch (ClassNotFoundException ex) { 
            System.out.println("ClassNotFoundException is caught"); 
        }  
    } 
}

Example of Externalizable
class Employee implements Externalizable  {

    private static final long serialVersionUID = 1L;
    private Integer id;

    public Employee(){
           System.out.println("No-arg constructor called");
    }

    public Employee(Integer id) {
           System.out.println("1-arg constructor called");
           this.id = id;
    }

    @Override
    public String toString() {
           return "Employee [id=" + id + "]";
    }

    /*
     * define how Serialization process will write objects.  
     */
    @Override
    public void writeExternal(ObjectOutput oo) throws IOException {
           oo.writeInt(id);
    }


    /*
     * define how deSerialization process will read objects.  
     */
    @Override
    public void readExternal(ObjectInput in) throws IOException,  
                                                ClassNotFoundException {
           this.id=in.readInt();
    }

}

public class ExternalizableConstructorCheck {

    public static void main(String[] args) {

           Employee object1 = new Employee(8);

           try {
                   OutputStream fout = new FileOutputStream("ser.txt");
                   ObjectOutput oout = new ObjectOutputStream(fout);
                   System.out.println("Serialization process has started, serializing employee objects...");
                   oout.writeObject(object1);
                   fout.close();
                   oout.close();
                   System.out.println("Object Serialization completed.");                 

               //DeSerialization process >               

                   InputStream fin=new FileInputStream("ser.txt");
                   ObjectInput oin=new ObjectInputStream(fin);
                   System.out.println("\nDeSerialization process has started, displaying employee objects...");
                   Employee emp=(Employee)oin.readObject();
                   System.out.println(emp);
                   fin.close();
                 oin.close();
                 System.out.println("Object DeSerialization completed.");             

           } catch (IOException | ClassNotFoundException  e) {
                  e.printStackTrace();
           }

    }

}

content/java/design_pattern/creational/S.body:
Singleton
Singleton Pattern says that just"define a class that has only one instance and provides a global point of access to it".
In other words, a class must ensure that only single instance should be created and single object can be used by all other classes.
There are two forms of singleton design pattern

Early Instantiation: creation of instance at load time.
Lazy Instantiation: creation of instance when required.

To create the singleton class, we need to have static member of class, private constructor and static factory method.

Static member: It gets memory only once because of static, itcontains the instance of the Singleton class.
Private constructor: It will prevent to instantiate the Singleton class from outside the class.
Static factory method: This provides the global point of access to the Singleton object and returns the instance to the caller.

class A{  
 private static A obj;  
 private A(){}  

 public static A getA(){  
   if (obj == null){  
      synchronized(Singleton.class){  
        if (obj == null){  
            obj = new Singleton();//instance will be created at request time  
        }  
    }              
    }  
  return obj;  
 }  

}

Significance of Serialization in Singleton Pattern
If singleton class is Serializable, you can serialize the singleton instance. Once it is serialized, you can deserialize it but it will not return the singleton object.
To resolve this issue, you need to override the readResolve() method that enforces the singleton. It is called just after the object is deserialized. It returns the singleton object.
public class A implements Serializable {  
    //your code of singleton  
    protected Object readResolve() {  
        return getA();  
       }  
}

content/java/design_pattern/creational/P.body:
Prototyp
Prototype Pattern says that cloning of an existing object instead of creating new one and can also be customized as per the requirement (Cloneable).
This pattern should be followed, if the cost of creating a new object is expensive and resource intensive.
Usage of Prototype Pattern

When the classes are instantiated at runtime.
When the cost of creating an object is expensive or complicated.

public interface PrototypeCapable extends Cloneable {
    public PrototypeCapable clone() throws CloneNotSupportedException;
}

public class Movie implements PrototypeCapable {
    private String name = null;
    public String getName() {
        return name;
    }
    public void setName(String name) {
        this.name = name;
    }

    @Override
    public Movie clone() throws CloneNotSupportedException {
        System.out.println("Cloning Movie object..");
        return (Movie) super.clone();
    }

    @Override
    public String toString() {
        return "Movie";
    }
}

public class Album implements PrototypeCapable {
    private String name = null;
    public String getName() {
        return name;
    }
    public void setName(String name) {
        this.name = name;
    }
    @Override
    public Album clone() throws CloneNotSupportedException {
        System.out.println("Cloning Album object..");
        return (Album) super.clone();
    }
    @Override
    public String toString() {
        return "Album";
    }
}

public class PrototypeFactory {

    public static class ModelType {
        public static final String MOVIE = "movie";
        public static final String ALBUM = "album";
    }
    private static java.util.Map prototypes = new java.util.HashMap();

    static {
        prototypes.put(ModelType.MOVIE, new Movie());
        prototypes.put(ModelType.ALBUM, new Album());
    }

    public static PrototypeCapable getInstance(final String s) throws CloneNotSupportedException {
        return ((PrototypeCapable) prototypes.get(s)).clone();
    }
}

